import "./ToggleSwitch.scss"
const ToggleSwitch = ({checked, onChange}) => (
    <div>
      <input
        type="checkbox"
        className="toggle-switch-checkbox"
        checked={checked}
        onChange={e => onChange(e.target.checked)}
      />
    </div>
  );

  export default ToggleSwitch;
